import styled from 'styled-components';

const Header = styled.div`
  background-color: #fff;
  grid-area: header;
  border-top-right-radius: 8px;
  box-shadow: 0px 2px 16px -2px rgba(0, 0, 0, 0.15);
  z-index: 10;
`;

export default Header;
